import React, { useState } from 'react';
import { Modal, Button, Form } from 'react-bootstrap';

const EditStudentModal = ({ show, onHide, student, onSave }) => {
  // Estado inicial con valores por defecto para evitar null
  const [formData, setFormData] = useState(student || {
    name: '',
    grade: '',
    address: '',
    serviceType: 'both',
    monthlyAmount: 120.00
  });

  // Manejar cambios en los inputs
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  // Manejar cambio en el tipo de servicio
  const handleServiceChange = (e) => {
    const serviceType = e.target.value;
    const monthlyAmount = serviceType === 'both' ? 120.00 : 80.00;
    setFormData({
      ...formData,
      serviceType,
      monthlyAmount
    });
  };

  // Manejar envÃ­o del formulario
  const handleSubmit = () => {
    onSave(formData);
    onHide();
  };

  return (
    <Modal show={show} onHide={onHide} centered>
      <Modal.Header closeButton>
        <Modal.Title>Editar estudiante</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Form>
          <Form.Group className="mb-3">
            <Form.Label>Nombre completo</Form.Label>
            <Form.Control
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              placeholder="Nombre del estudiante"
              required
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Grado acadÃ©mico</Form.Label>
            <Form.Control
              type="text"
              name="grade"
              value={formData.grade}
              onChange={handleChange}
              placeholder="Ej: 5to Grado"
              required
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>DirecciÃ³n</Form.Label>
            <Form.Control
              type="text"
              name="address"
              value={formData.address}
              onChange={handleChange}
              placeholder="DirecciÃ³n del estudiante"
              required
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Tipo de servicio</Form.Label>
            <div>
              <Form.Check
                type="radio"
                id="service-both"
                label="Ida y vuelta ($120)"
                name="serviceType"
                value="both"
                checked={formData.serviceType === 'both'}
                onChange={handleServiceChange}
              />
              <Form.Check
                type="radio"
                id="service-pickup"
                label="Solo ida ($80)"
                name="serviceType"
                value="pickup"
                checked={formData.serviceType === 'pickup'}
                onChange={handleServiceChange}
              />
              <Form.Check
                type="radio"
                id="service-dropoff"
                label="Solo vuelta ($80)"
                name="serviceType"
                value="dropoff"
                checked={formData.serviceType === 'dropoff'}
                onChange={handleServiceChange}
              />
            </div>
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Monto mensual</Form.Label>
            <Form.Control
              type="text"
              value={`$${formData.monthlyAmount.toFixed(2)}`}
              readOnly
            />
          </Form.Group>
        </Form>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={onHide}>
          Cancelar
        </Button>
        <Button variant="primary" onClick={handleSubmit}>
          Guardar cambios
        </Button>
      </Modal.Footer>
    </Modal>
  );
};

export default EditStudentModal;
